    return (
      <div className="Bar">
        <div className="Bar">
        <img alt="logo" className="photo" src={bear}/>
        <h1 style = {{marginRight: "40%", paddingTop: "10px"}}>StudyBear</h1>
        </div>
        <div className="rightSide">
          <h3 style ={{paddingRight: "20px", paddingTop: "15px"}}>About us</h3>
          <h3 style ={{paddingRight: "20px", paddingTop: "15px"}}>How it works</h3>
          <h3 style ={{paddingRight: "20px", paddingTop: "15px"}}>Contact us</h3>
        </div>
      </div>
    );
  }
}

export default App;
